      encodeMsgPack(
          (w) -> {
            w.writeMapHeader(3);
            encodeSimpleArrayProp(w);

            w.writeString(wrapString("emptyDefaultArray"));
            w.writeArrayHeader(1);

            w.writeMapHeader(1);
