					/* rCollection.get(item) */.doOnSubscribe((x) -> System.out.println(" +" + rCat.incrementAndGet()))
					.doOnTerminate(() -> System.out.println(" -" + rCat.decrementAndGet())));
	System.out.println(concat.sequential().collectList().block());
}

