				.one(user);
		List<UserCol> found = couchbaseTemplate.findByQuery(UserCol.class)
				.withConsistency(QueryScanConsistency.REQUEST_PLUS).inScope(scopeName).inCollection(collectionName)
				.matching(query).all();
