                                               AggregationFunction.SUM,
                                               LoggingContextHelper.getMetricsTags(serviceLoggingContext),
                                               new ArrayList<>()), 3L);
  } finally {
    pipeline.stopAndWait();
    loggerContext.stop();
    collectionService.stopAndWait();
  }
