  resultSet = (List<FileCountBySize>) response.getEntity();
  assertEquals(2, resultSet.size());
  assertTrue(resultSet.stream().allMatch(o -> o.getVolume().equals("vol1") &&
      o.getBucket().equals("bucket1")));

  // Test for non-existent bucket
