      "bucket1") && o.getFileSize() == 131072);

  // Test for non-existent fileSize
  response = utilizationEndpoint.getFileCounts("vol1", "bucket1", 1310725);
  resultSet = (List<FileCountBySize>) response.getEntity();
  assertEquals(0, resultSet.size());
}

