public void shouldDropUndeclaredPropertiesOnReset() {
  // given
  final MinimalPOJO pojo = new MinimalPOJO();
  pojo.wrap(MSG_PACK);

  final MutableDirectBuffer writeBuffer = new UnsafeBuffer(new byte[pojo.getLength()]);

  // when
  pojo.reset();

  // then
  pojo.wrap(
      encodeMsgPack(
          (w) -> {
            w.writeMapHeader(1);
